Un placer haber estado en la hermosa TUCUMÁN 🇦🇷 presentando mi libro LA GESTIÓN DEL DIÁLOGO.

Gracias a la fundación @fedyliber por invitarme al Coloquio por los 40 AÑOS DE DEMOCRACIA, donde pude encontrarme con buenos amigos y compartir una muy interesante conversación pública con Julio Velarde, presidente del Banco Central de Perú. Julio construyó un enorme ejemplo internacional de banco independiente del poder político con resultados asombrosos que deberíamos imitar.

